import React from "react";
import Navbar from "./components/navbar";
import Hero from "./components/Hero";
import Card from "./components/Card";
import Footer from "./components/footer";
import "./styles.css";

function App() {
  return (
    <div>
      <Navbar />
      <Card />
      <Footer />
    </div>
  );
}
export default App;
